import React, { useState, useEffect } from "react";
import { MDBBtn, MDBContainer, MDBCol, MDBRow } from "mdb-react-ui-kit";
import Transaction from "../components/Transactions/Transaction";
import { useParams } from "react-router-dom";
import TransactionModal from "../components/Transactions/TransactionModal";
import Form from "react-bootstrap/Form";

import useAxiosPrivate from "../hooks/useAxiosPrivate";

function Transactions() {
  const [transactionsData, setTransactionsData] = useState([]);

  const axiosInstance = useAxiosPrivate();

  useEffect(() => {
    axiosInstance.get("transactions/").then((res) => {
      console.log(res.data);
      setTransactionsData(res.data);
    });
  }, []);

  function sortDescriptionAsc() {
    const myData = []
      .concat(transactionsData)
      .sort((a, b) => (a.description > b.description ? 1 : -1));
    console.log(myData);
    setTransactionsData(myData);
  }

  function sortDescriptionDesc() {
    const myData = []
      .concat(transactionsData)
      .sort((a, b) => (a.description > b.description ? -1 : 1));
    console.log(myData);
    setTransactionsData(myData);
  }

  function sortDateAddedAsc() {
    const myData = []
      .concat(transactionsData)
      .sort((a, b) => (a.date_added > b.date_added ? -1 : 1));
    console.log(myData);
    setTransactionsData(myData);
  }

  function sortDateAddedDesc() {
    const myData = []
      .concat(transactionsData)
      .sort((a, b) => (a.date_added > b.date_added ? 1 : -1));
    console.log(myData);
    setTransactionsData(myData);
  }

  function sortDateUpdatedAsc() {
    const myData = []
      .concat(transactionsData)
      .sort((a, b) => (a.date_processed > b.date_processed ? -1 : 1));
    console.log(myData);
    setTransactionsData(myData);
  }

  function sortDateUpdatedDesc() {
    const myData = []
      .concat(transactionsData)
      .sort((a, b) => (a.date_processed > b.date_processed ? 1 : -1));
    console.log(myData);
    setTransactionsData(myData);
  }

  console.log(transactionsData);
  return (
    <div>
      <MDBContainer>
        <MDBRow>
          <MDBCol>
            <h3>Aufträge</h3>
          </MDBCol>
          <MDBCol>
            <TransactionModal />
          </MDBCol>
        </MDBRow>
        <MDBRow className="my-3">
          <MDBCol>
            <MDBBtn onClick={() => sortDescriptionAsc()}>
              Beschreibung absteigend
            </MDBBtn>
          </MDBCol>
          <MDBCol>
            <MDBBtn onClick={() => sortDescriptionDesc()}>
              Beschreibung aufsteigend
            </MDBBtn>
          </MDBCol>
        </MDBRow>
        <MDBRow className="mb-3">
          <MDBCol>
            <MDBBtn onClick={() => sortDateAddedAsc()}>
              Datum hinzugefügt absteigend
            </MDBBtn>
          </MDBCol>
          <MDBCol>
            <MDBBtn onClick={() => sortDateAddedDesc()}>
              Datum hinzugefügt aufsteigend
            </MDBBtn>
          </MDBCol>
        </MDBRow>
        <MDBRow className="mb-3">
          <MDBCol>
            <MDBBtn onClick={() => sortDateUpdatedAsc()}>
              Datum aktualisiert absteigend
            </MDBBtn>
          </MDBCol>
          <MDBCol>
            <MDBBtn onClick={() => sortDateUpdatedDesc()}>
              Datum aktualisiert aufsteigend
            </MDBBtn>
          </MDBCol>
        </MDBRow>
        <nav className="my-4 navbar navbar-expand-lg navbar-light bg-light">
          <MDBContainer fluid>
            {" "}
            <Form.Select>
              <option>Hinzugefügt absteigend</option>
              <option>Hinzugefügt aufsteigend</option>
              <option>Aktualisiert absteigend</option>
              <option>Aktualisiert aufsteigend</option>
              <option>Beschreibung absteigend</option>
              <option>Beschreibung aufsteigend</option>
            </Form.Select>
          </MDBContainer>
        </nav>
        {transactionsData.map((transactionData) => (
          <React.Fragment>
            <Transaction
              key={transactionData.id}
              id={transactionData.id}
              title={transactionData.description}
              added={transactionData.date_added}
              exportAddress={transactionData.partnership.partner.name}
              exportStreet={transactionData.partnership.partner.street}
              exportCity={transactionData.partnership.partner.city}
              exportCountry={transactionData.partnership.partner.country_code}
              importAddress={transactionData.importAddress}
              importStreet={transactionData.importStreet}
              importCity={transactionData.importCity}
              importCountry={transactionData.importCountry}
              stakeholderCount={transactionData.stakeholderCount}
              lastChange={transactionData.date_processed}
            />
            <br />
          </React.Fragment>
        ))}
      </MDBContainer>
    </div>
  );
}

export default Transactions;
